const Singleproduct = (propp) =>{
    const { plst } = propp;
    console.log(propp);
    return(
                
        <div className="col-xl-3 col-lg-3 col-md-3 col-sm-6 col-6">
        <div className="card text-center card-product">
            <div className="card-product__img">
                <Link  href={`/singlepro?slug=${ plst.slug }-${ plst.id }`}>
                    <a><img src={ plst.image.sourceUrl} alt="Product image"/></a>
                </Link>
                <div className="favorit-items">
                    <i className="ti ti-heart"></i>
                </div>
            </div>
            <div>
                <h4 className="card-product__title">
                    <Link  href={`/singlepro?slug=${ plst.slug }-${ plst.id }`}>
                        <a href="#">{ plst.name ? plst.name : '' }</a>
                    </Link>
                </h4>
                <p className="card-product__price"><span className="cross"><del>{ plst.regularPrice ? plst.regularPrice : '' }
                </del></span>&nbsp;&nbsp;{ plst.salePrice ? plst.salePrice : '' }</p>
            </div>
        </div>
    </div>
           
    );
}
export default Singleproduct;
